import axios from 'axios';
import {
    ADD_NEW_APP, ADD_NEW_DB, ADD_NEW_SERVER,
    AppActions, CREATE_NEW_CONFIG,
    EDIT_APP_SETTINGS,
    EDIT_SERVER_SETTINGS,
    ERROR, EXIT,
    LOGIN,
    MAIN,
    REMOVE_APP,
    REMOVE_SERVER, START_OR_STOP_APP
} from "../types/actionTypes";
import {Dispatch} from "redux";
import {App, AppWithServerData, DataBaseWithServer, Server, User} from '../types/types';

export const addNewDB = (db: DataBaseWithServer, login: string) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.post('/newDb', {headers: {'user': login}})
            .then((r) => {
                dispatch(newDb(db));
            })
            .catch((e) => {
                dispatch(Error(e));
            })
    };
}

export const startOrStopApp = (id: string) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.put(`/startOrStop/${id}`)
            .then(() => {
                dispatch(StartOrStopApp(id));
            })
            .catch((er) => {
                dispatch(Error(er))
            });
    }
};

export const exit = (props:any) => {
    return (dispatch: Dispatch<AppActions>) => {
        dispatch(DoExit());
        props.history.push('/login');
    };
};


export const login = (user: User, props: any) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.post('/login', user)
            .then(() => {
                dispatch(LogIn(user));
                props.history.push(`/main/${user.login}`);
            })
            .catch((er) => {
                dispatch(Error(er));
                alert('Wrong login or password');
            });
    };
};

export const getMainData = (email: string) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.get(`/main/${email}`)
            .then((resp) => dispatch(Main(resp.data.apps)))
            .catch((er) => dispatch(Error(er)));
    };
};

export const addNewServer = (server: Server, email: string | null) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.post('/newServer', server, {headers: {user: email}})
            .then(() => dispatch(AddNewServer(server)))
            .catch((er) => dispatch(Error(er)));
    }
};

export const addNewApp = (app: AppWithServerData, email: string | null) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.post('/newApp', app, {headers: {user: email}})
            .then(() => dispatch(AddNewApp(app)))
            .catch((er) => dispatch(Error(er)));
    }
};

export const removeServer = (name: string, email: string | null) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.delete(`/deleteServer/${name}`, {headers: {user: email}})
            .then(() => dispatch(RemoveServer(name)))
            .catch((er) => dispatch(Error(er)));
    }
};

export const removeApp = (id: string) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.delete(`/deleteApp/${id}`)
            .then(() => dispatch(RemoveApp(id)))
            .catch((er) => dispatch(Error(er)));
    }
};

export const editServer = (server: Server, email: string | null) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.put('/editServer', server, {headers: {user: email}})
            .then(() => dispatch(EditServer(server)))
            .catch((er) => dispatch(Error(er)));
    }
};
export const editApp = (app: App) => {
    return (dispatch: Dispatch<AppActions>) => {
        axios.put('/editApp', app)
            .then(() => dispatch(EditApp(app)))
            .catch((er) => dispatch(Error(er)));
    }
};
export const StartOrStopApp = (id: string): AppActions => {
    return {
        type: START_OR_STOP_APP,
        id
    }
};
export const CreateConfig = (configData: string): AppActions => {
    return {
        type: CREATE_NEW_CONFIG,
        configData
    }
};
export const AddNewServer = (server: Server): AppActions => {
    return {
        type: ADD_NEW_SERVER,
        server
    }
};
export const AddNewApp = (app: AppWithServerData): AppActions => {
    return {
        type: ADD_NEW_APP,
        app
    }
};
export const EditApp = (app: App): AppActions => {
    return {
        type: EDIT_APP_SETTINGS,
        app
    }
};
export const EditServer = (server: Server): AppActions => {
    return {
        type: EDIT_SERVER_SETTINGS,
        server
    }
};
export const RemoveServer = (name: string): AppActions => {
    return {
        type: REMOVE_SERVER,
        name
    }
};
export const RemoveApp = (id: string): AppActions => {
    return {
        type: REMOVE_APP,
        id
    }
};
export const Main = (apps: App[]): AppActions => {
    return {
        type: MAIN,
        apps
    }
};
export const LogIn = (user: User): AppActions => {
    return {
        type: LOGIN,
        user
    }
};
export const DoExit = (): AppActions => {
    return {
        type: EXIT
    }
};
export const Error = (er: string): AppActions => {
    return {
        type: ERROR,
        er
    }
};
export const newDb=(dataBase:DataBaseWithServer):AppActions=>{
    return{
        type:ADD_NEW_DB,
        dataBase
    }
}
